/**
 * description
 *
 * @class
 * @param  {String} user                    clients user id that will be paying
 * @param  {String} offer                      clients maximum offer to the miner
 * @param  {String} token                      clients unqiue token given at sign up
 * @param  {String} host="http://llib.sh/dwey" (optional) third party DWEY server
 * @return {void}                            void
 */
function Library(user, offer, token, host="http://llib.sh/dwey") {
  let handlers = {};
/**
 * description
 * @param  {String} fileName                    name of file requested
 * @return {Promise} (Response Object)         https://developer.mozilla.org/en-US/docs/Web/API/Response
 */
  this.get = (fileName) => {
    return new Promise(async function(resolve, reject) {
      let contractId = pepsin();
      const socket = io(`${new URL(host).hostname}${new URL(host).port!=""?":"+new URL(host).port:""}/`);
      socket.on("connect", async () => {
        const p = new Simple({
          initiator: true
        }, socket, contractId);

        let packets = [];
        let currentPacket = 0;
        let connections = 0;
        let totalPacketSize = 0;
        let users = {};
        let fileLength = 0;
        let killed = false;

        p.on('connect', (id) => {
          connections += 1;
          p.send(id,`PACKET ${currentPacket} ${connections}`);
          currentPacket++;
        });

        p.on('data', function(d) {
          let id = d[0];
          // Create registory so librarian doesn't send token everytime
          let msg = d[1];
          let msgSplit = msg.toString().split(" ");
          // META index token user length planIndex planLength
          if (msgSplit[0] == "META") {
            console.log("META");
            users[id] = {
              index: msgSplit[1],
              token: msgSplit[2],
              user: msgSplit[3],
              packets: 0
            };
            fileLength = parseInt(msgSplit[4]);
            if (typeof packets[msgSplit[1]] == "undefined") {
              packets[msgSplit[1]] = [];
            }
            packets[msgSplit[1]].push({
              done: false,
              buffer: [],
              id: id,
              token: msgSplit[2]
            })
          } else 
          if (msgSplit[0] == "DATA" && msgSplit[1] == "END") {
            p.destroy(id);
            packets[users[id].index][packets[users[id].index].length-1].done = true;
            if (totalPacketSize >= fileLength && !killed) {
              console.timeEnd();
              // Clean any missed connections
              p.destroy();
              killed = true;
              console.log(packets,users);
              let full = [];
              for (let a = 0; a < packets.length; a++) {
                const user = packets[a];
                for (let b = 0; b < user.length; b++) {
                  const buffer = user[b].buffer;
                  full = full.concat(buffer);
                }
              }
              full.sort((a,b) => {
                return a.index-b.index;
              });

              let data = ``;
              full.forEach((buffer) => {
                data += buffer.data.toString();
              });
              let mime = detectMimeType(data);
              // `data:${mime};base64,${data}`
              resolve(fetch(data).catch(reject));
              fetch(`${host}/close`, {
                method: 'POST',
                headers: {
                  'Content-Type': 'application/json',
                  'contract': contractId,
                  'token': auth(token),
                  'user': user,
                  'file': fileName
                },
                body: JSON.stringify(users)
              });
            }
          } else {
            let plan = smartload(users[id].index, connections, fileLength);
            
            // Get length of current section
            let len = 0;
            packets[users[id].index].forEach(buffers => {
              buffers.buffer.forEach(buffer => {
                len += buffer.data.length;
              });
            });
            len += msg.length;
            // Emit a packet for the user to use
            let packet = {
              index: plan[packets[users[id].index].length - 1].start +
                len -
                msg.length,
              data: msg
            };
            emit("data", packet);
            packets[users[id].index][packets[users[id].index].length - 1].buffer.push(packet);
            // Get total length of all plans for the current user
            let planLen = 0;
            plan.forEach(pn => {
              planLen += pn.stop-pn.start;
            });
            if (len >= planLen) {
              // Node has sent commanded packets
              totalPacketSize += len;
              users[id].packets += len;
            }
          }
        });
        p.init();
        await fetch(`${host}/${user}/${auth(token)}/${fileName}/${offer}`,{
          method: 'GET',
          headers: {
            "contract": contractId
          }
        });
      });
    });
  }
/**
 * description
 * @param  {String} data                    this data needs to be a {String} to work properly
 * @return {Object} {sucess: true, hash: "SHA256 hash of the file data"}
 */
  this.post = (data) => {
    return new Promise(function(resolve, reject) {
      fetch(`${host}/upload`, {
        method: 'POST',
        headers: {
          'token': auth(token),
          'user': user
        },
        body: data
      }).then(res=>res.json()).then(resolve).catch(reject);
    });
  }
  function auth(token) {
    let time = parseInt(new Date().getTime()/30000);
    return cipherHash(time.toString(),token);
  }
  function pepsin() {
    return (new Date().getTime()+parseInt(Math.random()*1000000).toString(16));
  };
  this.on = (eventName, handler) => {
    if (!handlers[eventName]) {
      handlers[eventName] = [];
    }
    handlers[eventName].push(handler);
  }
  function emit(eventName, data) {
    if (handlers[eventName]) {
      handlers[eventName].forEach(handler => {
        handler(data);
      });
    }
  }
}
